public static void assertPropertyEquals(Properties props,
                                        String key,
                                        String expected) {
  String val = props.getProperty(key);
  if (expected == null) {
    assertNull("Non null property " + key + " = " + val, val);
  } else {
    assertEquals("property " + key + " = " + val,
                        expected,
                        val);
  }
}
